import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

// Componentes simples inline para teste
const Home = () => (
  <div className="container text-center py-5">
    <h1>Bem-vindo</h1>
    <Link to="/leonardo" className="btn btn-primary m-2">Leonardo</Link>
    <Link to="/joao" className="btn btn-primary m-2">João Paulo</Link>
  </div>
);

const Leonardo = () => (
  <div className="container py-4">
    <Link to="/" className="btn btn-secondary">← Voltar</Link>
    <h1>Leonardo</h1>
  </div>
);

const Joao = () => (
  <div className="container py-4">
    <Link to="/" className="btn btn-secondary">← Voltar</Link>
    <h1>João Paulo</h1>
  </div>
);

function App() {
  return (
    <Router>
      <div className="App">
        <nav className="navbar navbar-dark bg-dark">
          <div className="container">
            <Link className="navbar-brand" to="/">Currículos</Link>
            <Link className="nav-link text-light" to="/">Home</Link>
            <Link className="nav-link text-light" to="/leonardo">Leonardo</Link>
            <Link className="nav-link text-light" to="/joao">João Paulo</Link>
          </div>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/leonardo" element={<Leonardo />} />
          <Route path="/joao" element={<Joao />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
